var $bm_rt;
var disableElastic, ampVar, freqVar, decayVar;
try {
    disableElastic = effect('Elastic')('Disable Elastic').value;
    ampVar = $bm_div(effect('Elastic')('Amplitude').value, 1000);
    freqVar = effect('Elastic')('Frequency').value;
    decayVar = effect('Elastic')('Decay').value;
    function elastic(amp, freq, decay) {
        var n, t, v;
        n = 0;
        if (numKeys > 0) {
            n = nearestKey(time).index;
            if (key(n).time > time) {
                n--;
            }
        }
        if (n == 0) {
            t = 0;
        } else {
            t = $bm_sub(time, key(n).time);
        }
        if (n > 0 && t < 1) {
            v = velocityAtTime($bm_sub(key(n).time, $bm_div(thisComp.frameDuration, 10)));
            return $bm_sum(value, $bm_div($bm_mul($bm_mul(v, amp), Math.sin($bm_mul($bm_mul($bm_mul(freq, t), 2), Math.PI))), Math.exp($bm_mul(decay, t))));
        } else {
            return value;
        }
    }
    ;
    $bm_rt = [
        elastic(ampVar, freqVar, decayVar),
        value
    ][disableElastic];
} catch (err) {
    $bm_rt = value;
}
;

